import React, { useRef, useEffect, useState, useCallback } from 'react';
import { Stage, Layer, Image as KonvaImage, Text, Transformer, Group, Line, Rect } from 'react-konva';
import { DesignLayer, BaseProduct, ProductVariant, PathLayer } from '../types';
import { CANVAS_SIZE } from '../constants';

// --- Helper Hook for Loading Images ---
const useImage = (url: string) => {
  const [image, setImage] = useState<HTMLImageElement | null>(null);
  useEffect(() => {
    if (!url) return;
    const img = new window.Image();
    img.crossOrigin = 'Anonymous';
    img.src = url;
    img.onload = () => setImage(img);
  }, [url]);
  return [image];
};

interface DesignCanvasProps {
  product: BaseProduct;
  variant: ProductVariant;
  layers: DesignLayer[];
  selectedId: string | null;
  onSelect: (id: string | null) => void;
  onChange: (newLayers: DesignLayer[]) => void;
  isDrawingMode: boolean;
  drawingSettings: { color: string; width: number };
  stageRef: React.RefObject<any>;
}

const URLImage = ({ src, layerConfig, onSelect, onChange }: any) => {
  const [image] = useImage(src);
  const shapeRef = useRef<any>(null);

  return (
    <KonvaImage
      image={image || undefined}
      {...layerConfig}
      ref={shapeRef}
      draggable
      onClick={onSelect}
      onTap={onSelect}
      onDragEnd={(e: any) => {
        onChange({
          ...layerConfig,
          x: e.target.x(),
          y: e.target.y(),
        });
      }}
      onTransformEnd={(e: any) => {
        const node = shapeRef.current;
        const scaleX = node.scaleX();
        const scaleY = node.scaleY();
        node.scaleX(1);
        node.scaleY(1);
        onChange({
          ...layerConfig,
          x: node.x(),
          y: node.y(),
          width: Math.max(5, node.width() * scaleX),
          height: Math.max(node.height() * scaleY),
          rotation: node.rotation(),
          scaleX: scaleX, // Store scale
          scaleY: scaleY,
        });
      }}
    />
  );
};

const DesignCanvas: React.FC<DesignCanvasProps> = ({
  product,
  variant,
  layers,
  selectedId,
  onSelect,
  onChange,
  isDrawingMode,
  drawingSettings,
  stageRef
}) => {
  const [bgImage] = useImage(variant.imageFront); // Simplified for demo, should switch based on side
  const transformerRef = useRef<any>(null);

  // Selection handling
  useEffect(() => {
    if (selectedId && transformerRef.current) {
        // We need to find the node. In a real app we might use refs array or id query
        // For simplicity in this demo, we rely on Konva finding the node by name/id if we attached it properly
        // Or we pass the ref from the child. 
        // Here is a workaround for the demo structure:
        const stage = transformerRef.current.getStage();
        const selectedNode = stage.findOne('.' + selectedId);
        if (selectedNode) {
          transformerRef.current.nodes([selectedNode]);
          transformerRef.current.getLayer().batchDraw();
        } else {
            transformerRef.current.nodes([]);
        }
    } else if (transformerRef.current) {
      transformerRef.current.nodes([]);
    }
  }, [selectedId, layers]);

  // Free drawing handlers
  const isDrawing = useRef(false);

  const handleMouseDown = (e: any) => {
    const stage = e.target.getStage();
    // Deselect if clicked on empty area
    const clickedOnEmpty = e.target === stage.findOne('#bg-overlay') || e.target === stage;
    if (clickedOnEmpty && !isDrawingMode) {
      onSelect(null);
    }

    if (!isDrawingMode) return;

    isDrawing.current = true;
    const pos = stage.getPointerPosition();
    const newLine: PathLayer = {
      id: `path-${Date.now()}`,
      type: 'path',
      points: [pos.x, pos.y],
      stroke: drawingSettings.color,
      strokeWidth: drawingSettings.width,
      tension: 0.5,
      x: 0, y: 0, rotation: 0, scaleX: 1, scaleY: 1, visible: true, zIndex: layers.length
    };
    onChange([...layers, newLine]);
  };

  const handleMouseMove = (e: any) => {
    if (!isDrawingMode || !isDrawing.current) return;

    const stage = e.target.getStage();
    const point = stage.getPointerPosition();
    const lastLayer = layers[layers.length - 1];

    if (lastLayer.type === 'path') {
        const newPoints = lastLayer.points.concat([point.x, point.y]);
        const updatedLayers = layers.slice(0, layers.length - 1);
        updatedLayers.push({ ...lastLayer, points: newPoints });
        onChange(updatedLayers);
    }
  };

  const handleMouseUp = () => {
    isDrawing.current = false;
  };

  return (
    <div className="bg-white shadow-lg rounded-lg overflow-hidden flex justify-center items-center p-4">
      {/* We need to use 'div' wrapper for ref if Konva isn't actually loaded in the environment 
          But assuming the User follows instructions to have deps, here is the JSX */}
      <Stage
        width={CANVAS_SIZE}
        height={CANVAS_SIZE}
        onMouseDown={handleMouseDown}
        onMouseMove={handleMouseMove}
        onMouseUp={handleMouseUp}
        onTouchStart={handleMouseDown}
        onTouchMove={handleMouseMove}
        onTouchEnd={handleMouseUp}
        ref={stageRef}
        className="bg-gray-100 border border-gray-200"
      >
        <Layer>
          {/* Product Background */}
          {bgImage && (
            <KonvaImage
              image={bgImage}
              width={CANVAS_SIZE}
              height={CANVAS_SIZE}
              listening={false} // Don't steal clicks
            />
          )}

          {/* Print Area Guide (semi-transparent white or dashed line) */}
          <Rect 
            x={product.printArea.left}
            y={product.printArea.top}
            width={product.printArea.width}
            height={product.printArea.height}
            strokeDash={[5, 5]}
            stroke="rgba(0,0,0,0.2)"
            id="print-area-guide"
            listening={false}
          />

          {/* Clipping Group for Print Area */}
          <Group
             clipX={product.printArea.left}
             clipY={product.printArea.top}
             clipWidth={product.printArea.width}
             clipHeight={product.printArea.height}
          >
             {/* Interaction Overlay for clicking 'through' the group if needed, 
                 but mostly we want the items themselves to be clickable */}

             {layers.map((layer, i) => {
               const isSelected = layer.id === selectedId;

               if (layer.type === 'text') {
                 return (
                   <Text
                     key={layer.id}
                     id={layer.id}
                     name={layer.id} // Important for selector
                     text={(layer as any).text}
                     x={layer.x}
                     y={layer.y}
                     fontSize={(layer as any).fontSize}
                     fontFamily={(layer as any).fontFamily}
                     fill={(layer as any).fill}
                     stroke={(layer as any).stroke}
                     strokeWidth={(layer as any).strokeWidth || 0}
                     shadowColor={(layer as any).shadowColor}
                     shadowBlur={(layer as any).shadowBlur}
                     draggable={!isDrawingMode}
                     onClick={() => onSelect(layer.id)}
                     onTap={() => onSelect(layer.id)}
                     onDragEnd={(e) => {
                        const newLayers = [...layers];
                        newLayers[i] = { ...layer, x: e.target.x(), y: e.target.y() };
                        onChange(newLayers);
                     }}
                   />
                 );
               } else if (layer.type === 'image') {
                 return (
                   <URLImage
                     key={layer.id}
                     src={(layer as any).src}
                     layerConfig={{...layer, name: layer.id}}
                     onSelect={() => onSelect(layer.id)}
                     onChange={(newAttrs: any) => {
                        const newLayers = [...layers];
                        newLayers[i] = newAttrs;
                        onChange(newLayers);
                     }}
                   />
                 );
               } else if (layer.type === 'path') {
                   return (
                       <Line
                        key={layer.id}
                        id={layer.id}
                        name={layer.id}
                        points={(layer as any).points}
                        stroke={(layer as any).stroke}
                        strokeWidth={(layer as any).strokeWidth}
                        tension={(layer as any).tension}
                        lineCap="round"
                        lineJoin="round"
                        draggable={!isDrawingMode}
                        onClick={() => onSelect(layer.id)}
                        onDragEnd={(e) => {
                            const newLayers = [...layers];
                            newLayers[i] = { ...layer, x: e.target.x(), y: e.target.y() };
                            onChange(newLayers);
                        }}
                       />
                   )
               }
               return null;
             })}
          </Group>

          {/* Transformer layer - sits on top */}
          <Transformer ref={transformerRef} boundBoxFunc={(oldBox, newBox) => {
              // Limit resize if needed
              if (newBox.width < 5 || newBox.height < 5) {
                return oldBox;
              }
              return newBox;
            }} 
          />
        </Layer>
      </Stage>

    </div>
  );
};

export default DesignCanvas;

import React, { useState } from 'react';
import { Type, Image as ImageIcon, PenTool, Layers, Upload, Plus, Trash2, ArrowUp, ArrowDown } from 'lucide-react';
import { AVAILABLE_FONTS, CLIPARTS } from '../constants';
import { DesignLayer, TextLayer, ImageLayer } from '../types';

interface ToolbarProps {
  layers: DesignLayer[];
  selectedId: string | null;
  onAddLayer: (layer: DesignLayer) => void;
  onUpdateLayer: (id: string, updates: Partial<DesignLayer>) => void;
  onDeleteLayer: (id: string) => void;
  onReorderLayer: (id: string, direction: 'up' | 'down') => void;
  setDrawingMode: (active: boolean) => void;
  isDrawingMode: boolean;
  drawingSettings: { color: string; width: number };
  setDrawingSettings: (settings: any) => void;
}

const Toolbar: React.FC<ToolbarProps> = ({
  layers,
  selectedId,
  onAddLayer,
  onUpdateLayer,
  onDeleteLayer,
  onReorderLayer,
  setDrawingMode,
  isDrawingMode,
  drawingSettings,
  setDrawingSettings
}) => {
  const [activeTab, setActiveTab] = useState<'text' | 'image' | 'draw' | 'layers'>('text');
  const [inputText, setInputText] = useState('Hello World');

  const selectedLayer = layers.find(l => l.id === selectedId);

  const handleAddText = () => {
    const newLayer: TextLayer = {
      id: `text-${Date.now()}`,
      type: 'text',
      text: inputText,
      fontFamily: 'Inter',
      fontSize: 24,
      fill: '#000000',
      align: 'center',
      x: 300,
      y: 200,
      rotation: 0,
      scaleX: 1,
      scaleY: 1,
      visible: true,
      zIndex: layers.length
    };
    onAddLayer(newLayer);
    setActiveTab('layers'); // Switch to layers to see it
  };

  const handleUpload = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (file) {
      const reader = new FileReader();
      reader.onload = (event) => {
        const img = new Image();
        img.src = event.target?.result as string;
        img.onload = () => {
            const isLowRes = img.naturalWidth < 1000; // Example threshold
            const newLayer: ImageLayer = {
                id: `img-${Date.now()}`,
                type: 'image',
                src: event.target?.result as string,
                naturalWidth: img.naturalWidth,
                naturalHeight: img.naturalHeight,
                lowResWarning: isLowRes,
                x: 300 - 100,
                y: 200 - 100,
                rotation: 0,
                scaleX: 0.5,
                scaleY: 0.5,
                visible: true,
                zIndex: layers.length
            };
            onAddLayer(newLayer);
            if(isLowRes) alert("Warning: This image is low resolution and may print poorly.");
        }
      };
      reader.readAsDataURL(file);
    }
  };

  const addClipart = (url: string) => {
      const newLayer: ImageLayer = {
          id: `clip-${Date.now()}`,
          type: 'image',
          src: url,
          naturalWidth: 512,
          naturalHeight: 512,
          x: 250,
          y: 250,
          rotation: 0,
          scaleX: 0.3,
          scaleY: 0.3,
          visible: true,
          zIndex: layers.length
      };
      onAddLayer(newLayer);
  };

  return (
    <div className="w-80 bg-white border-l border-gray-200 flex flex-col h-full overflow-y-auto">
      {/* Tabs */}
      <div className="flex border-b border-gray-200">
        <button onClick={() => { setActiveTab('text'); setDrawingMode(false); }} className={`flex-1 py-3 flex justify-center ${activeTab === 'text' ? 'text-blue-600 border-b-2 border-blue-600' : 'text-gray-500'}`}><Type size={20} /></button>
        <button onClick={() => { setActiveTab('image'); setDrawingMode(false); }} className={`flex-1 py-3 flex justify-center ${activeTab === 'image' ? 'text-blue-600 border-b-2 border-blue-600' : 'text-gray-500'}`}><ImageIcon size={20} /></button>
        <button onClick={() => { setActiveTab('draw'); setDrawingMode(true); }} className={`flex-1 py-3 flex justify-center ${activeTab === 'draw' ? 'text-blue-600 border-b-2 border-blue-600' : 'text-gray-500'}`}><PenTool size={20} /></button>
        <button onClick={() => { setActiveTab('layers'); setDrawingMode(false); }} className={`flex-1 py-3 flex justify-center ${activeTab === 'layers' ? 'text-blue-600 border-b-2 border-blue-600' : 'text-gray-500'}`}><Layers size={20} /></button>
      </div>

      <div className="p-4 flex-1">
        {/* TEXT TAB */}
        {activeTab === 'text' && (
          <div className="space-y-4">
            <h3 className="font-semibold text-gray-800">Add Text</h3>
            <div className="flex gap-2">
              <input 
                type="text" 
                value={inputText}
                onChange={(e) => setInputText(e.target.value)}
                className="flex-1 border border-gray-300 rounded px-3 py-2 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
              <button onClick={handleAddText} className="bg-blue-600 text-white p-2 rounded hover:bg-blue-700"><Plus size={20} /></button>
            </div>

            {selectedLayer?.type === 'text' && (
              <div className="mt-6 space-y-4 border-t pt-4">
                <h4 className="text-sm font-medium text-gray-500">Edit Text</h4>
                <div>
                    <label className="text-xs text-gray-500">Font Family</label>
                    <select 
                        className="w-full border p-2 rounded text-sm"
                        value={(selectedLayer as TextLayer).fontFamily}
                        onChange={(e) => onUpdateLayer(selectedLayer.id, { fontFamily: e.target.value })}
                    >
                        {AVAILABLE_FONTS.map(f => <option key={f.value} value={f.value} style={{fontFamily: f.value}}>{f.name}</option>)}
                    </select>
                </div>
                <div>
                    <label className="text-xs text-gray-500">Color</label>
                    <input 
                        type="color" 
                        className="w-full h-8 rounded cursor-pointer"
                        value={(selectedLayer as TextLayer).fill}
                        onChange={(e) => onUpdateLayer(selectedLayer.id, { fill: e.target.value })}
                    />
                </div>
                <div>
                    <label className="text-xs text-gray-500">Font Size</label>
                    <input 
                        type="range" min="12" max="100"
                        className="w-full"
                        value={(selectedLayer as TextLayer).fontSize}
                        onChange={(e) => onUpdateLayer(selectedLayer.id, { fontSize: parseInt(e.target.value) })}
                    />
                </div>
              </div>
            )}
          </div>
        )}

        {/* IMAGE TAB */}
        {activeTab === 'image' && (
            <div className="space-y-6">
                <div>
                    <h3 className="font-semibold text-gray-800 mb-2">Upload Image</h3>
                    <label className="flex flex-col items-center justify-center w-full h-32 border-2 border-gray-300 border-dashed rounded-lg cursor-pointer bg-gray-50 hover:bg-gray-100">
                        <div className="flex flex-col items-center justify-center pt-5 pb-6">
                            <Upload className="w-8 h-8 mb-3 text-gray-400" />
                            <p className="text-sm text-gray-500"><span className="font-semibold">Click to upload</span></p>
                            <p className="text-xs text-gray-500">PNG, JPG</p>
                        </div>
                        <input type="file" className="hidden" accept="image/*" onChange={handleUpload} />
                    </label>
                </div>

                <div>
                    <h3 className="font-semibold text-gray-800 mb-2">Clipart Library</h3>
                    <div className="grid grid-cols-2 gap-2">
                        {CLIPARTS.map(clip => (
                            <button key={clip.id} onClick={() => addClipart(clip.url)} className="border p-2 rounded hover:border-blue-500 bg-white">
                                <img src={clip.url} alt={clip.category} className="w-full h-auto object-contain" />
                            </button>
                        ))}
                    </div>
                </div>
            </div>
        )}

        {/* DRAW TAB */}
        {activeTab === 'draw' && (
            <div className="space-y-4">
                 <h3 className="font-semibold text-gray-800">Free Drawing</h3>
                 <div className="bg-yellow-50 text-yellow-800 text-xs p-2 rounded">
                    Draw directly on the canvas!
                 </div>
                 <div>
                    <label className="text-xs text-gray-500">Brush Color</label>
                    <input 
                        type="color" 
                        className="w-full h-8 rounded cursor-pointer"
                        value={drawingSettings.color}
                        onChange={(e) => setDrawingSettings({...drawingSettings, color: e.target.value})}
                    />
                </div>
                <div>
                    <label className="text-xs text-gray-500">Brush Size: {drawingSettings.width}px</label>
                    <input 
                        type="range" min="1" max="20"
                        className="w-full"
                        value={drawingSettings.width}
                        onChange={(e) => setDrawingSettings({...drawingSettings, width: parseInt(e.target.value)})}
                    />
                </div>
            </div>
        )}

        {/* LAYERS TAB */}
        {activeTab === 'layers' && (
            <div className="space-y-2">
                <h3 className="font-semibold text-gray-800 mb-2">Layers</h3>
                {layers.length === 0 && <p className="text-sm text-gray-400 italic">No layers yet.</p>}
                {[...layers].reverse().map((layer, index) => {
                    // Reverse for display (top layer first), but we need actual index for logic
                    const realIndex = layers.length - 1 - index;
                    return (
                        <div 
                            key={layer.id} 
                            className={`flex items-center justify-between p-2 rounded border ${selectedId === layer.id ? 'border-blue-500 bg-blue-50' : 'border-gray-200 bg-white'}`}
                        >
                            <div className="flex items-center gap-2 cursor-pointer flex-1" onClick={() => {}}>
                                {layer.type === 'text' && <Type size={16} className="text-gray-500"/>}
                                {layer.type === 'image' && <ImageIcon size={16} className="text-gray-500"/>}
                                {layer.type === 'path' && <PenTool size={16} className="text-gray-500"/>}
                                <span className="text-sm truncate w-24">
                                    {layer.type === 'text' ? (layer as TextLayer).text : layer.type}
                                </span>
                            </div>
                            <div className="flex gap-1">
                                <button onClick={() => onReorderLayer(layer.id, 'up')} className="p-1 hover:bg-gray-200 rounded text-gray-600"><ArrowUp size={14} /></button>
                                <button onClick={() => onReorderLayer(layer.id, 'down')} className="p-1 hover:bg-gray-200 rounded text-gray-600"><ArrowDown size={14} /></button>
                                <button onClick={() => onDeleteLayer(layer.id)} className="p-1 hover:bg-red-100 rounded text-red-500"><Trash2 size={14} /></button>
                            </div>
                        </div>
                    );
                })}
            </div>
        )}
      </div>
    </div>
  );
};

export default Toolbar;

import React, { useState, useRef } from 'react';
import DesignCanvas from '../components/DesignCanvas';
import Toolbar from '../components/Toolbar';
import { MOCK_PRODUCTS } from '../constants';
import { DesignState, DesignLayer, BaseProduct, ProductVariant } from '../types';
import { ShoppingCart, Share2, Save, Download } from 'lucide-react';

const CustomerPage: React.FC = () => {
  const [selectedProduct, setSelectedProduct] = useState<BaseProduct>(MOCK_PRODUCTS[0]);
  const [selectedVariant, setSelectedVariant] = useState<ProductVariant>(MOCK_PRODUCTS[0].variants[0]);

  const [designState, setDesignState] = useState<DesignState>({
    productId: MOCK_PRODUCTS[0].id,
    variantId: MOCK_PRODUCTS[0].variants[0].id,
    side: 'front',
    layers: { front: [], back: [] }
  });

  const [selectedLayerId, setSelectedLayerId] = useState<string | null>(null);
  const [isDrawingMode, setDrawingMode] = useState(false);
  const [drawingSettings, setDrawingSettings] = useState({ color: '#000000', width: 3 });

  const stageRef = useRef<any>(null);

  const currentLayers = designState.layers[designState.side];

  const updateLayers = (newLayers: DesignLayer[]) => {
    setDesignState(prev => ({
        ...prev,
        layers: {
            ...prev.layers,
            [prev.side]: newLayers
        }
    }));
  };

  const handleAddLayer = (layer: DesignLayer) => {
    updateLayers([...currentLayers, layer]);
    setSelectedLayerId(layer.id);
  };

  const handleUpdateLayer = (id: string, updates: Partial<DesignLayer>) => {
    const newLayers = currentLayers.map(l => l.id === id ? { ...l, ...updates } : l);
    updateLayers(newLayers);
  };

  const handleDeleteLayer = (id: string) => {
    updateLayers(currentLayers.filter(l => l.id !== id));
    setSelectedLayerId(null);
  };

  const handleReorderLayer = (id: string, direction: 'up' | 'down') => {
    const idx = currentLayers.findIndex(l => l.id === id);
    if (idx === -1) return;

    const newLayers = [...currentLayers];
    if (direction === 'up' && idx < newLayers.length - 1) {
        [newLayers[idx], newLayers[idx + 1]] = [newLayers[idx + 1], newLayers[idx]];
    } else if (direction === 'down' && idx > 0) {
        [newLayers[idx], newLayers[idx - 1]] = [newLayers[idx - 1], newLayers[idx]];
    }
    updateLayers(newLayers);
  };

  const handleSave = () => {
      // Simulate saving to backend
      console.log('Saving Design:', designState);
      alert('Design saved! (Check console for object)');
  };

  return (
    <div className="flex flex-col h-screen bg-slate-50">
      {/* Header */}
      <header className="h-16 bg-white border-b border-gray-200 px-6 flex items-center justify-between z-10">
        <div className="flex items-center gap-4">
            <h1 className="text-xl font-bold font-oswald text-blue-700 tracking-wide">PrintMaster Studio</h1>
            <div className="h-6 w-px bg-gray-300 mx-2"></div>
            <select 
                className="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block p-2"
                onChange={(e) => {
                    const prod = MOCK_PRODUCTS.find(p => p.id === e.target.value);
                    if (prod) {
                        setSelectedProduct(prod);
                        setSelectedVariant(prod.variants[0]);
                    }
                }}
            >
                {MOCK_PRODUCTS.map(p => <option key={p.id} value={p.id}>{p.name}</option>)}
            </select>
        </div>

        <div className="flex items-center gap-3">
             <button onClick={() => setDesignState(prev => ({...prev, side: prev.side === 'front' ? 'back' : 'front'}))} className="text-sm font-medium text-gray-600 hover:text-blue-600 px-3 py-1 border rounded">
                Side: {designState.side.toUpperCase()}
             </button>
             <button onClick={handleSave} className="flex items-center gap-2 px-4 py-2 text-sm font-medium text-gray-700 hover:bg-gray-100 rounded-lg">
                <Save size={18} /> Save
             </button>
             <button className="flex items-center gap-2 px-4 py-2 text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 rounded-lg shadow-sm">
                <ShoppingCart size={18} /> Add to Cart - {(selectedVariant.price).toLocaleString()}đ
             </button>
        </div>
      </header>

      {/* Main Workspace */}
      <div className="flex flex-1 overflow-hidden">

        {/* Left: Product & Variants (Mini Configurator) */}
        <div className="w-20 bg-white border-r border-gray-200 flex flex-col items-center py-4 gap-4">
             <div className="text-xs text-gray-400 font-bold uppercase tracking-wider">Color</div>
             {selectedProduct.variants.map(v => (
                 <button 
                    key={v.id}
                    onClick={() => setSelectedVariant(v)}
                    className={`w-8 h-8 rounded-full border-2 shadow-sm ${selectedVariant.id === v.id ? 'border-blue-600 scale-110' : 'border-gray-200'}`}
                    style={{ backgroundColor: v.colorHex }}
                    title={v.name}
                 />
             ))}
        </div>

        {/* Center: Canvas Area */}
        <div className="flex-1 bg-gray-100 overflow-auto flex items-center justify-center p-8 relative">
            <DesignCanvas 
                product={selectedProduct}
                variant={selectedVariant}
                layers={currentLayers}
                selectedId={selectedLayerId}
                onSelect={setSelectedLayerId}
                onChange={updateLayers}
                isDrawingMode={isDrawingMode}
                drawingSettings={drawingSettings}
                stageRef={stageRef}
            />

            {/* Size Chart Popup Trigger (Visual only for demo) */}
            <button className="absolute bottom-4 left-4 bg-white px-3 py-1 rounded shadow text-xs text-gray-500 underline">
                View Size Chart
            </button>
        </div>

        {/* Right: Tools */}
        <Toolbar 
            layers={currentLayers}
            selectedId={selectedLayerId}
            onAddLayer={handleAddLayer}
            onUpdateLayer={handleUpdateLayer}
            onDeleteLayer={handleDeleteLayer}
            onReorderLayer={handleReorderLayer}
            setDrawingMode={setDrawingMode}
            isDrawingMode={isDrawingMode}
            drawingSettings={drawingSettings}
            setDrawingSettings={setDrawingSettings}
        />
      </div>
    </div>
  );
};

export default CustomerPage;

