                <div style={{
                    position: designState.side === 'front' ? 'relative' : 'absolute',
                    left: designState.side === 'front' ? 'auto' : '-9999px',
                    visibility: designState.side === 'front' ? 'visible' : 'hidden',
                    zIndex: designState.side === 'front' ? 10 : 0
                }}>
                    <DesignCanvas 
                        product={selectedProduct}
                        variant={selectedVariant}
                        side="front"
                        layers={designState.layers.front}
                        selectedId={designState.side === 'front' ? selectedLayerId : null}
                        onSelect={setSelectedLayerId}
                        onChange={(layers) => updateSideLayers('front', layers)}
                        isDrawingMode={designState.side === 'front' && isDrawingMode}
                        drawingSettings={drawingSettings}
                        stageRef={frontStageRef}
                    />
                </div>

                {/* BACK CANVAS */}
                <div style={{
                     position: designState.side === 'back' ? 'relative' : 'absolute',
                     left: designState.side === 'back' ? 'auto' : '-9999px',
                     visibility: designState.side === 'back' ? 'visible' : 'hidden',
                     zIndex: designState.side === 'back' ? 10 : 0
                }}>
                    <DesignCanvas 
                        product={selectedProduct}
                        variant={selectedVariant}
                        side="back"
                        layers={designState.layers.back}
                        selectedId={designState.side === 'back' ? selectedLayerId : null}
                        onSelect={setSelectedLayerId}
                        onChange={(layers) => updateSideLayers('back', layers)}
                        isDrawingMode={designState.side === 'back' && isDrawingMode}
                        drawingSettings={drawingSettings}
                        stageRef={backStageRef}
                    />
                </div>
            </div>

            {/* Size Chart Popup Trigger */}
            <button 
                onClick={() => setShowSizeChart(true)}
                className="absolute bottom-4 left-4 bg-white px-3 py-1 rounded shadow text-xs text-gray-500 underline z-20 hover:text-blue-600 transition-colors"
            >
                View Size Chart
            </button>
        </div>

        {/* Right: Tools */}
        <Toolbar 
            layers={currentLayers}
            selectedId={selectedLayerId}
            onAddLayer={handleAddLayer}
            onUpdateLayer={handleUpdateLayer}
            onDeleteLayer={handleDeleteLayer}
            onReorderLayer={handleReorderLayer}
            setDrawingMode={setDrawingMode}
            isDrawingMode={isDrawingMode}
            drawingSettings={drawingSettings}
            setDrawingSettings={setDrawingSettings}
        />
      </div>

      {/* Size Chart Modal */}
      {showSizeChart && (
        <div className="fixed inset-0 z-50 flex items-center justify-center bg-black/50 backdrop-blur-sm p-4 animate-in fade-in duration-200">
            <div className="absolute inset-0" onClick={() => setShowSizeChart(false)}></div>
            <div className="bg-white rounded-xl shadow-2xl max-w-2xl w-full overflow-hidden relative z-10 animate-in zoom-in-95 duration-200">
                <button 
                    onClick={() => setShowSizeChart(false)}
                    className="absolute top-4 right-4 p-2 bg-gray-100 rounded-full hover:bg-gray-200 text-gray-600 transition-colors"
                >
                    <X size={20} />
                </button>
                <div className="p-8">
                    <h3 className="text-2xl font-bold font-oswald text-slate-800 mb-2">Size Guide</h3>
                    <p className="text-gray-500 mb-6">Find your perfect fit for the {selectedProduct.name}</p>

                    <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
                        {/* Image Illustration */}
                        <div className="bg-gray-50 rounded-lg p-4 flex items-center justify-center border border-gray-100">
                            <img 
                                src="https://cdn-icons-png.flaticon.com/512/3345/3345397.png" 
                                alt="Measurement Guide" 
                                className="w-full max-w-[200px] opacity-80"
                            />
                        </div>

                        {/* Table */}
                        <div className="overflow-hidden rounded-lg border border-gray-200">
                            <table className="w-full text-sm text-left text-gray-600">
                                <thead className="text-xs text-gray-700 uppercase bg-gray-50 border-b border-gray-200">
                                    <tr>
                                        <th className="px-4 py-3">Size</th>
                                        <th className="px-4 py-3">Width</th>
                                        <th className="px-4 py-3">Length</th>
                                    </tr>
                                </thead>
                                <tbody className="divide-y divide-gray-100">
                                    <tr className="hover:bg-gray-50">
                                        <td className="px-4 py-3 font-medium text-gray-900">S</td>
                                        <td className="px-4 py-3">18" / 46cm</td>
                                        <td className="px-4 py-3">28" / 71cm</td>
                                    </tr>
                                    <tr className="hover:bg-gray-50">
                                        <td className="px-4 py-3 font-medium text-gray-900">M</td>
                                        <td className="px-4 py-3">20" / 51cm</td>
                                        <td className="px-4 py-3">29" / 74cm</td>
                                    </tr>
                                    <tr className="hover:bg-gray-50">
                                        <td className="px-4 py-3 font-medium text-gray-900">L</td>
                                        <td className="px-4 py-3">22" / 56cm</td>
                                        <td className="px-4 py-3">30" / 76cm</td>
                                    </tr>
                                    <tr className="hover:bg-gray-50">
                                        <td className="px-4 py-3 font-medium text-gray-900">XL</td>
                                        <td className="px-4 py-3">24" / 61cm</td>
                                        <td className="px-4 py-3">31" / 79cm</td>
                                    </tr>
                                    <tr className="hover:bg-gray-50">
                                        <td className="px-4 py-3 font-medium text-gray-900">2XL</td>
                                        <td className="px-4 py-3">26" / 66cm</td>
                                        <td className="px-4 py-3">32" / 81cm</td>
                                    </tr>
                                </tbody>
                            </table>
                        </div>
                    </div>

                    <div className="mt-6 text-xs text-gray-400 bg-gray-50 p-3 rounded">
                        <strong>Note:</strong> Measurements are taken with the shirt laying flat. Width is measured from armpit to armpit. Length is measured from the highest point of the shoulder to the bottom hem.
                    </div>
                </div>
            </div>
        </div>
      )}
    </div>
  );
};

export default CustomerPage;
